package cql4s

import cql4s.compiler.QueryCompiler
import cql4s.utils.{FindAll, NonEmptyListOfFields}


class Select[TableName, TableColumns, Fields, Where <: LogicalExpr](
  val table: Table[TableName, TableColumns],
  val fields: Fields,
  val where: Where
):

  def compile[Input, Output](using compiler: QueryCompiler[this.type, Input, Output]): Query[Input, Output] =
    compiler.build(this)

  def take[NewFields](f: Selectable[TableColumns] => NewFields)(using NonEmptyListOfFields[NewFields]): Select[TableName, TableColumns, NewFields, Where] =
    Select(table, f(table), where)

  def where[NewWhere <: LogicalExpr](f: Selectable[TableColumns] => NewWhere): Select[TableName, TableColumns, Fields, NewWhere] =
    Select(table, fields, f(table))

  // todo: can a macro or inline generate this?
  def take[C1 <: Singleton, X](c1: C1)(using finder: FindAll[TableColumns, (C1), X]): Select[TableName, TableColumns, X, Where] = Select(table, finder.get(table.*), where)
  def take[C1 <: Singleton, C2 <: Singleton, X](c1: C1, c2: C2)(using finder: FindAll[TableColumns, (C1, C2), X]): Select[TableName, TableColumns, X, Where] = Select(table, finder.get(table.*), where)
